import React from "react";
import {
  Badge,
  Card,
  CardBody,
  CardHeader,
  Col,
  Row,
  Table,
  CardImg
} from "reactstrap";

const OldMatch = ({ oldMatch }) => {
  console.log(oldMatch);
  return (
    <Row>
      <Col xs="12">
        <Card>
          <CardHeader>
            <i className="fa fa-align-justify"></i> Random match results on {oldMatch.dateMatch}
          </CardHeader>
        </Card>
      </Col>
    </Row>
  );
};

export default OldMatch;
